import React from 'react';

import grid from '../images/grid.svg';
import { Row, Col, Image } from 'react-bootstrap';

const CollectScreen = () => {
  return (
    <Row>
      <Col>
        <Image src={grid} alt='grid' />
      </Col>
    </Row>
  );
};

export default CollectScreen;
